import ActionConstants from "./entries-manager-action-constants";

const Actions = {
    _addEntry: (entry) => {
        console.log(entry)
        return {
            type: ActionConstants.ADD_ENTRY_REQUEST,
            entry
        };
    },
    _fetchEntry:() => {
        return {
            type:ActionConstants.FETCH_ENTRY_REQUEST
        }
    }
};

export default Actions;
